glsl3.vert:
precision highp float;
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
uniform CCLocal {
  mat4 cc_matWorld;
  mat4 cc_matWorldIT;
};
  in vec3 a_position;
  in vec4 a_color;
  #if USE_TINT
    in vec4 a_color0;
  #endif
  in vec2 a_uv0;
  out vec2 v_uv0;
  out vec4 v_light;
  #if USE_TINT
    out vec4 v_dark;
  #endif
  void main () {
    mat4 mvp;
    #if CC_USE_MODEL
      mvp = cc_matViewProj * cc_matWorld;
    #else
      mvp = cc_matViewProj;
    #endif
    v_uv0 = a_uv0;
    v_light = a_color;
    #if USE_TINT
      v_dark = a_color0;
    #endif
    gl_Position = mvp * vec4(a_position, 1);
  }

glsl3.frag:
precision highp float;
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
in vec4 v_light;
#if USE_TINT
  in vec4 v_dark;
#endif
#if USE_TEXTURE
  in vec2 v_uv0;
  uniform sampler2D texture;
#endif
void main () {
  vec4 texColor = vec4(1, 1, 1, 1);
  #if USE_TEXTURE
    texColor = texture2D(texture, v_uv0);
  #endif
  if (texColor.a > 0.5) {
    #if USE_TINT
      gl_FragColor = v_dark;
    #else
      gl_FragColor = v_light;
    #endif
  } else {
      discard;
  }
}

